package com.example.cffapp;

import android.graphics.Bitmap;
import android.graphics.BitmapFactory;
import android.os.Build;

import androidx.annotation.RequiresApi;

import java.util.Base64;

public class Tool {

    @RequiresApi(api = Build.VERSION_CODES.O)
    public static Bitmap stringToImage(String imgString){
        String string = "";
        byte[] imgchua = string.getBytes();
        Bitmap bitmap = BitmapFactory.decodeByteArray(imgchua,0,imgchua.length);
        if(imgString == null)
        {
            return bitmap;
        }
        byte [] img = Base64.getDecoder().decode(String.valueOf(imgString.toCharArray()));
        BitmapFactory.Options options = new BitmapFactory.Options();
        bitmap = BitmapFactory.decodeByteArray(img,0,img.length);
        return bitmap;
    }
}
